// C:\Users\Administrator\OneDrive\Documente\GitHub\salarizare\modern-backend\frontend\src\components\salaries\DiurnaReport.js
import React, { useState } from 'react';
import api from '../../services/api';
import FormInput from '../shared/forms/FormInput';
import Button from '../shared/buttons/Button';

const DiurnaReport = () => {
   const [report, setReport] = useState(null);
   const [filters, setFilters] = useState({
       startDate: '',
       endDate: '',
       driverId: ''
   });

   const generateReport = async () => {
       const response = await api.get('/reports/diurna', { params: filters });
       setReport(response.data);
   };

   return (
       <div className="space-y-6">
           <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
               <FormInput
                   label="Data Start"
                   type="date"
                   value={filters.startDate}
                   onChange={e => setFilters({...filters, startDate: e.target.value})}
               />
               <FormInput
                   label="Data Final"
                   type="date"
                   value={filters.endDate}
                   onChange={e => setFilters({...filters, endDate: e.target.value})}
               />
               <Button onClick={generateReport}>Generează Raport</Button>
           </div>

           {report && (
               <div className="mt-6">
                   <table className="min-w-full divide-y divide-gray-200">
                       <thead>
                           <tr>
                               <th>Șofer</th>
                               <th>Total Zile</th>
                               <th>Total Diurnă</th>
                           </tr>
                       </thead>
                       <tbody>
                           {report.entries.map((entry, index) => (
                               <tr key={index}>
                                   <td>{entry.sofer.nume}</td>
                                   <td>{entry.totalZile}</td>
                                   <td>{entry.totalDiurna} EUR</td>
                               </tr>
                           ))}
                       </tbody>
                   </table>
               </div>
           )}
       </div>
   );
};

export default DiurnaReport;
